import React from 'react';
import styled from 'styled-components';

const FriendBlock = styled.div`
  width: 100%;
`;
const ProfileImage = styled.div``;
const Nickname = styled.div``;

const Friend = () => {
  return (
    <FriendBlock>
      <ProfileImage />
      <Nickname>나니</Nickname>
    </FriendBlock>
  );
};

export default Friend;
